      Awards: [] // {[ [name: "", institution: "", date: ""], ...]}
    };
  }

  editName() {}

  render() {
    return (
      <div>
        {/* Input */}
        <Form />

        {/* Output */}
        <Name />
        <Contact />
        <Experience />
        <Skills />
        <Education />
        <Awards />
      </div>
    );
  }
}

export default App;
